masks.initializationCode:
X = [];
Y = [];
if (length(rep_seq_t) ~= length(rep_seq_y)),
  error('Length of time vector and output vector must be the same.')
end
dbl_rep_seq_t = double(rep_seq_t);
dbl_rep_seq_y = double(rep_seq_y);
period = max(dbl_rep_seq_t) - min(dbl_rep_seq_t);
period = str2num(sprintf('%0.5g',period));
[X, Y] = genRepeatingSequenceBlockIconData(dbl_rep_seq_t, dbl_rep_seq_y);

%ParentBlock = get_param(gcb,'Parent');
%Ts=get_param(ParentBlock,'UserData');
%if isempty(Ts)
%    Ts=1;% dummy sample time to prevent errors
%end

X = [];
Y = [];
if (length(rep_seq_t) ~= length(rep_seq_y)),
  error('Length of time vector and output vector must be the same.')
end
dbl_rep_seq_t = double(rep_seq_t);
dbl_rep_seq_y = double(rep_seq_y);
period = max(dbl_rep_seq_t) - min(dbl_rep_seq_t);
period = str2num(sprintf('%0.5g',period));
[X, Y] = genRepeatingSequenceBlockIconData(dbl_rep_seq_t, dbl_rep_seq_y);

blkH = gcbh;
blkHandle = handle(gcbh);

SampleTime = pidpack.PIDConfig.maskInitialization(gcbh, SampleTime);

blkH = gcbh;
blkName = getfullname(blkH);

switch_blks = {'Switch','Switch2'}; 
for i = 1:length(switch_blks)
  set_param([blkName,'/',switch_blks{i}], ...
      'RndMeth', RndMeth, ...
	  'SaturateOnIntegerOverflow', DoSatur);
end

propBlk = [blkName, '/Data Type Propagation'];

if strcmp(OutputDataTypeScalingMode, 'Same as second input')
    set_param(propBlk, 'PropDataTypeMode', 'Inherit via propagation rule', ...
                       'PropScalingMode',  'Inherit via propagation rule');
else
    scaling = OutScaling;
    scalingMode = 'Specify via dialog';
    switch OutputDataTypeScalingMode
      case 'double'
        dataType = 'fixdt(''double'')';
      case 'single'
        dataType = 'fixdt(''single'')';
      case 'int8'
        dataType = 'fixdt(1,8,0)';
      case 'uint8'
        dataType = 'fixdt(0,8,0)';
      case 'int16'
        dataType = 'fixdt(1,16,0)';
      case 'uint16'
        dataType = 'fixdt(0,16,0)';
      case 'int32'
        dataType = 'fixdt(1,32,0)';
      case 'uint32'
        dataType = 'fixdt(0,32,0)';
      case 'Specify via dialog'
        dataType = OutDataType;
        if ~isempty(OutDataTypeStr) && isa(OutDataTypeStr,'Simulink.NumericType') 
          if strcmp(OutDataTypeStr.DataTypeMode, 'Fixed-point: unspecified scaling') 
            scalingMode = 'Obtain via best precision';
            range = [OutMin OutMax];
            range = range(~isinf(range));
            set_param(propBlk, 'ValuesUsedBestPrec', mat2str(range));
          end
        end
    end

    set_param(propBlk, 'PropDataTypeMode', 'Specify via dialog', ...
                       'PropScalingMode',  scalingMode, ...
                       'PropDataType',     dataType, ...
                       'PropScaling',      scaling);
end

blkH = gcbh;
blkName = getfullname(blkH);

switch_blks = {'Switch','Switch2'}; 
for i = 1:length(switch_blks)
  set_param([blkName,'/',switch_blks{i}], ...
      'RndMeth', RndMeth, ...
	  'SaturateOnIntegerOverflow', DoSatur);
end

propBlk = [blkName, '/Data Type Propagation'];

if strcmp(OutputDataTypeScalingMode, 'Same as second input')
    set_param(propBlk, 'PropDataTypeMode', 'Inherit via propagation rule', ...
                       'PropScalingMode',  'Inherit via propagation rule');
else
    scaling = OutScaling;
    scalingMode = 'Specify via dialog';
    switch OutputDataTypeScalingMode
      case 'double'
        dataType = 'fixdt(''double'')';
      case 'single'
        dataType = 'fixdt(''single'')';
      case 'int8'
        dataType = 'fixdt(1,8,0)';
      case 'uint8'
        dataType = 'fixdt(0,8,0)';
      case 'int16'
        dataType = 'fixdt(1,16,0)';
      case 'uint16'
        dataType = 'fixdt(0,16,0)';
      case 'int32'
        dataType = 'fixdt(1,32,0)';
      case 'uint32'
        dataType = 'fixdt(0,32,0)';
      case 'Specify via dialog'
        dataType = OutDataType;
        if ~isempty(OutDataTypeStr) && isa(OutDataTypeStr,'Simulink.NumericType') 
          if strcmp(OutDataTypeStr.DataTypeMode, 'Fixed-point: unspecified scaling') 
            scalingMode = 'Obtain via best precision';
            range = [OutMin OutMax];
            range = range(~isinf(range));
            set_param(propBlk, 'ValuesUsedBestPrec', mat2str(range));
          end
        end
    end

    set_param(propBlk, 'PropDataTypeMode', 'Specify via dialog', ...
                       'PropScalingMode',  scalingMode, ...
                       'PropDataType',     dataType, ...
                       'PropScaling',      scaling);
